import './List.css'
import Checkbox from "./components/Checkbox/Checkbox";

function List(){

    const rarity ="Consumer Grade";
    const hexCode = "#b1c3d9";

    return(
    <div className="container background-color:#b1c3d9">
        <input type="checkbox" className='gradient'></input>
        <div>{rarity}</div>
        <div hidden='true'>{hexCode}</div>
    </div>);
}

export default List;
